import { Box, Grid } from "@material-ui/core";
import Content from "./Content";
import Header from "./Header";

export default ({ children }) => (
  <Grid container direction="column">
    <Grid item>
      <Header />
    </Grid>
    <Grid item>
      <Content>{children}</Content>
    </Grid>
  </Grid>
);
